import "./App";

function CategoryButtons({filterCategory, setList, categories}) {
    return (
        <div>
            {categories.map((val, id) => {
                return (
                    <button onClick={() => filterCategory(val)}>
                        {val}
                    </button>
                )
            })}
        </div> 
    );
}

export default CategoryButtons;
